// Navbar.js

import React from "react";

const Navbar = ({ username }) => {
  return (
    <nav className="navbar">
      <div className="navbar-brand">My App</div>
      {username && <div className="navbar-user">Welcome, {username}</div>}
    </nav>
  );
};

export default Navbar;
